import React from "react";

const SubjectsPage = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Quản lý môn học</h1>
      <p>Đây là trang quản lý môn học đơn giản nhất.</p>
      <div
        style={{
          padding: "20px",
          backgroundColor: "#f0f0f0",
          borderRadius: "5px",
          margin: "20px 0",
        }}
      >
        <p>
          Nếu bạn thấy trang này, có thể vấn đề ở các dependencies hoặc
          component phức tạp.
        </p>
      </div>
    </div>
  );
};

export default SubjectsPage;
